window.bookSummaryJSON = "<p>Love or life. Henry or their child. The end of her family or the end of the world. Kate must choose. </p><p>During nine months of captivity, Kate Winters has survived a jealous goddess, a vengeful Titan and a pregnancy she never asked for. Now the Queen of the Gods wants her unborn child, and Kate can't stop her - until Cronus offers a deal. In exchange for her loyalty and devotion, the King of the Titans will spare humanity and let Kate keep her child. Yet even if Kate agrees, he'll destroy Henry, her mother and the rest of council. And if she refuses, Cronus will tear the world apart until every last god and mortal is dead. </p><p>With the fate of everyone she loves resting on her shoulders, Kate must do the impossible: find a way to defeat the most powerful being in existence, even if it costs her everything. </p><p>Even if it costs her eternity.</p>"; 
